import React, {  useEffect, useState } from 'react'
import './dreamBoy.css'

const Parent = () => {
    const [a,setA] = useState(-1);
    const [text,setText] = useState("");

    const increment = ()=>{
        const temp = a+1;
        setA(temp)
    }
    const decrement = ()=>{
        const temp = a-1;
        setA(temp)
    }

    useEffect(() => {
      console.log(`Hii a updated to ${a}`)
    }, [])
    
  return (
    <div className='main'>
        <h1>Dream Boy {a}</h1>
        <div className='main2'>
            
        <button type='button' onClick={()=>{increment()}}>Increment
            </button>

        <button type='button' onClick={()=>{decrement()}}>Decrement
            </button>
            
            </div>

            {
                a == 5 ? <div> <p>Hi I am 5 </p> </div> :
                a == 11? <div><p>Hi I am 11 yuhuuu </p></div>:
                <div>
                    Hi I am everything else
                </div>
            }
            <input type="text" value={text} onChange={(e)=>{setText(e.target.value)}}/>
    </div>
  )
}

export default Parent
